import React from 'react';
import './ContactMe.css';
/*
* TODO:
*  - Resize profile pic sizes so they can fit within the contact me container
*
* */
const ContactMe = () =>
{

    return(
        <div className='contact-me'>

            <div className='contact-me-container'>
                <h1>CONTACT ME</h1>
                <div className='paragraph-container'>
                    <p>Feel free to reach out to me via any social media or email regarding any serious inquiries such as
                        my resume or any ideas for collaboration. I am always open to and looking for any great projects to be a part of! </p>
                </div>

                <div className="icons-container">
                    <i className="fas fa-envelope-open-text fa-2x"/>
                    <i className="fab fa-instagram fa-2x"/>
                </div>
            </div>
        </div>

    );
}

export default ContactMe;
